import React, { useState, useCallback } from "react";
import ReactFlow, {
  MiniMap,
  Controls,
  Background,
  useNodesState,
  useEdgesState,
} from "reactflow";
import "reactflow/dist/style.css";

const nodeStyles = {
  main: { background: "#1E90FF", color: "#fff", borderRadius: "6px", padding: 10 },
  field: { background: "#333", color: "#fff", borderRadius: "25px", padding: "8px 20px" },
  bucket: { background: "#009688", color: "#fff", borderRadius: "8px", padding: 10 },
  dependent: { background: "#9C27B0", color: "#fff", borderRadius: "6px", padding: 10 },
};

const initialNodes = [
  { id: "DomainHourly", data: { label: "DomainHourly\nMain Report" }, position: { x: 400, y: 50 }, style: nodeStyles.main },
  { id: "advertiserId", data: { label: "advertiserId\nType: long" }, position: { x: 100, y: 200 }, style: nodeStyles.field },
  { id: "attribution", data: { label: "attributionCon...\nType: double" }, position: { x: 300, y: 200 }, style: nodeStyles.field },
  { id: "bundleId", data: { label: "bundleId\nType: string" }, position: { x: 500, y: 200 }, style: nodeStyles.field },
  { id: "campaignId", data: { label: "campaignId\nType: long" }, position: { x: 700, y: 200 }, style: nodeStyles.field },
  { id: "clicks", data: { label: "clicks\nType: long" }, position: { x: 900, y: 200 }, style: nodeStyles.field },
  { id: "more", data: { label: "+21 more..." }, position: { x: 1100, y: 200 }, style: nodeStyles.field },
  { id: "bucket", data: { label: "Bucket 9\nData Bucket" }, position: { x: 200, y: 400 }, style: nodeStyles.bucket },
  { id: "snowflake", data: { label: "DomainHourly\nSnowflake" }, position: { x: 450, y: 400 }, style: nodeStyles.main },
  { id: "dependent", data: { label: "ImpressionFactInput\nDependent Report" }, position: { x: 700, y: 400 }, style: nodeStyles.dependent },
];

const initialEdges = [
  { id: "e1", source: "DomainHourly", target: "advertiserId" },
  { id: "e2", source: "DomainHourly", target: "attribution" },
  { id: "e3", source: "DomainHourly", target: "bundleId" },
  { id: "e4", source: "DomainHourly", target: "campaignId" },
  { id: "e5", source: "DomainHourly", target: "clicks" },
  { id: "e6", source: "DomainHourly", target: "more" },
  { id: "e7", source: "attribution", target: "bucket" },
  { id: "e8", source: "bundleId", target: "snowflake" },
  { id: "e9", source: "campaignId", target: "dependent" },
];

export default function App() {
  const [nodes, , onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(
    initialEdges.map((e) => ({
      ...e,
      style: { stroke: "grey", strokeWidth: 2 },
    }))
  );

  const highlightPath = useCallback((nodeId) => {
    // Reset all edges to grey
    setEdges((eds) =>
      eds.map((e) => ({
        ...e,
        style: { stroke: "grey", strokeWidth: 2 },
      }))
    );

    // Walk backwards from nodeId to root
    let current = nodeId;
    const pathEdges = [];
    let found = true;
    while (found) {
      found = false;
      for (const e of initialEdges) {
        if (e.target === current) {
          pathEdges.push(e.id);
          current = e.source;
          found = true;
        }
      }
    }

    // Highlight the path edges
    setEdges((eds) =>
      eds.map((e) =>
        pathEdges.includes(e.id)
    ? { 
      ...e, 
      animated: true,
      style: { stroke: "darkviolet", strokeWidth: 3, strokeDasharray: "5 5" }
    }

          : e
      )
    );
  }, []);

  const onNodeClick = useCallback((_, node) => {
    highlightPath(node.id);
  }, [highlightPath]);

  return (
    <div style={{ height: "100vh" }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onNodeClick={onNodeClick}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background color="#555" gap={20} />
      </ReactFlow>
    </div>
  );
}
